import React from "react";

const Header = () => {
  
    return (
            <div className="card header">
                <div className="col s12 m6">
                <div className="card">
                    <div className="card-content main-header">
                    <span style={{direction:"rtl"}} className="card-title">ברוכים הבאים ל Use Mine ! <img style={{width:"45px"}} src="https://www2.multilizer.com/wp-content/uploads/2014/07/tool.jpg" alt="_blank" ></img></span>
                    <p className="headerText" style={{direction:"rtl"}}>
                קרה לכם פעם שהייתם צריכים לקדוח חור בקיר ולא הייתה לכם מקדחה? או להסתכל על הפטיפון הישן שלכם ולשאול מה אעשה איתו?  Use Mine היא דרך מהפכנית להרוויח כסף נוסף על ציוד שכבר בבעלותך או להשאיל ציוד באופן חד פעמי. 
                    </p>
                    
                    </div>
                </div>
                </div>
            </div>
    );
};

export default Header;
